class ModelType(Enum):
    """The various Xspec model types."""

    Add = auto()
    Mul = auto()
    Con = auto()


class LanguageStyle(Enum):
    """The various ways to define and call Xspec models."""

    CppStyle8 = auto()
    CStyle8 = auto()
    F77Style4 = auto()
    F77Style8 = auto()


class ParamType(Enum):
    """The Xspec parameter type."""

    Default = auto()
    Switch = auto()
    Scale = auto()
    Periodic = auto()


@dataclass
class XspecParameter:
    """An Xspec parameter."""

    paramtype: ParamType
    name: str
    default: float
    units: str | None = None
    frozen: bool = False
    softmin: float | None = None
    softmax: float | None = None
    hardmin: float | None = None
    hardmax: float | None = None
    delta: float | None = None


@dataclass
class XspecModel:
    """An Xspec model."""

    modeltype: ModelType
    name: str
    funcname: str
    language: LanguageStyle
    elo: float
    ehi: float
    parameters: Sequence[XspecParameter]
    use_errors: bool = False
    can_cache: bool = True


